package com.fsd;

public class Output {
	String title;
	String text;
	
	public String getTitle() {
		return title;
	}
	public void setTitle(String title) {
		this.title = title;
	}
	public String getText() {
		return text;
	}
	public void setText(String text) {
		this.text = text;
	}
	public Output() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Output(String title, String text) {
		super();
		this.title = title;
		this.text = text;
	}
	
	

}
